import React from 'react'
import Header from "../../component/Header";
import SubNavbar from "../../component/SubNavbar";
import Feature2 from '../../component/Feature2';

const Inbound = () => {

  const filters = [
    {
      label: "Filter by Ring Group",
      name: "filterByRingGroup",
      value: [
        "agents",
        "agents 2",
        "agents 3",
      ]
    },

    {
      label: "Filter by Phone Number",
      name: "filterByPhoneNumber",
      value: [
        "All phone numbers",
        "Phone number 1",
        "Phone number 2",
      ]
    },

  ]

  const dataLiTag = [
    "Total",
    "Answered",
    "Missed",
    "Abandoned",
    "Voicemail",
  ]

  const dataCalls = [
    {
      value: "2419",
      label: "Total Calls",
    },
    {
      value: "1196",
      label: "Answered Calls",
    },
    {
      value: "472",
      label: "Missed Calls",
    },
    {
      value: "233",
      label: "Abandoned Calls",
    },
    {
      value: "274",
      label: "Short Abandoned Calls",
    },
    {
      value: "320",
      label: "Voicemail",
    },

  ]

  return (
    <div id="inbound">
      <Header />
      <div className='main-content'>
        <SubNavbar />
        <Feature2 />

        <div style={{ display: "flex", padding: "0 60px 40px 40px" }}>
          {/* display filter */}
          {filters.map((filter, index) => {
            return (
              <div style={{ paddingRight: "80px" }}>
                <label for={filter.name}>{filter.label}</label>
                <br></br>
                <select name={filter.name} id={filter.name}
                  style={{ width: "240px", height: "30px", fontSize: "14px" }}
                >
                  {filter.value.map((optionValue, optionIndex) => {
                    return (
                      <option value={optionValue}>{optionValue}</option>
                    )
                  })}
                </select>
              </div>
            )
          })}

          {/* display navbar-feature2 */}
          <div style={{ padding: "20px 0 0 470px" }}>
            <ul className='navbar-feature2'>
              {dataLiTag.map((dataLi) => {
                return <li style={{ color: "rgb(0, 187, 255)" }}>{dataLi}</li>
              })}
            </ul>
          </div>
        </div>

        {/* display Calls */}
        <div style={{ display: "flex", padding: "0 60px 0 60px" }}>

        </div>
        


      </div>
    </div>
  )
}

export default Inbound
